const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are {props.age} years old</p>
    </div>
  )
}

const App = () => {
  const name = "Pietro"
  const age = 5000
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Geoff" age={67 * 33}/>
      <Hello name="Toffer" age = {age}/>
      <Hello name={name} age = {age} />
    </div>
  )
}

export default App;
